INSERT INTO `wp_posts` VALUES("31", "2", "2015-12-30 20:15:53", "2015-12-30 20:15:53", "<h3>BURRIS LOGISTICS ONLINE PRIVACY POLICY</h3>\r\nBurris Logistics is committed to protecting individual privacy and securing the personal information made available to us when you visit our website. If you chose to provide us with personal information, for example, by completing a Contact Us form, by signing up for our email list, or leaving a comment, we may use that information to respond to your message and/or to help us get you the information or services that you requested. Submitting this information is voluntary and is not required to access information on our site. We do not sell, rent, exchange, or otherwise disclose the information you provide outside the organization. Questions about the policy can be directed to <a href=\"mailto:mowens@burrislogistics.com\">mowens@burrislogistics.com</a>.\r\n<h3>BURRIS LOGISTICS COMMENT POLICY</h3>\r\nThank you for following Burris Logistics on our public sites. Burris Logistics participates in social media and other public sites in order to engage individuals and to share relevant information.\r\n\r\nPosted comments do not necessarily represent the views of Burris Logistics. External links on these sites do not constitute an endorsement by Burris Logistics.\r\n\r\nWhile we encourage our followers to share thoughts and opinions on our public sites, we expect that this will be done in a respectful manner. Burris Logistics does not agree with or endorse every comment that is posted on our pages. Although our goal is to accept the majority of comments posted, we reserve the right to remove any comment that contains hateful, defamatory, or profane language, personal attacks, promotional comments, and spam comments. All links posted as comments are subject to removal. Burris Logistics reserves the right to block an author from access or use of our public sites where the author engages in repeated violations of the Burris Logistics Comment Policy.\r\n\r\nPlease contact <a href=\"mailto:slauzen@burrislogistics.com\">slauzen@burrislogistics.com</a> with any questions about this policy.", "Privacy Policy", "", "publish", "closed", "closed", "", "privacy-policy", "", "", "2016-01-28 13:31:18", "2016-01-28 18:31:18", "", "0", "https://burrisfreight.com/?page_id=31", "0", "page", "", "0");
