INSERT INTO `wp_posts` VALUES("90", "1", "2016-01-08 18:48:11", "2016-01-08 18:48:11", "<strong>Where tradition meets innovation.</strong>\r\n\r\nWhile Burris Freight Management prides ourselves on traditional, direct communication with customers and carriers, we recognize that technology is critical to driving efficiency and timely information exchange.\r\n\r\nTheres no better way to build a relationship than through listening  which is why every new arrival to our roster begins with a conversation. Our logistic experts and account managers are available to answer any questions and provide trusted, experienced advice.\r\n\r\nOnce a carrier or customer is established, either EDI or web-based platforms are available for new load entry, load requests, load acceptance, status updates and equipment availability. In this way we can instantly identify carrier capacity and marry customers to the most efficient solution.\r\n\r\nWhether you are a customer shipping a load or a carrier looking to grow your operation, contact us today for access to our automated portal technology.", "Technology", "", "publish", "closed", "closed", "", "technology", "", "", "2016-02-02 11:01:10", "2016-02-02 16:01:10", "", "0", "https://burrisfreight.com/?page_id=90", "0", "page", "", "0");
