INSERT INTO `wp_posts` VALUES("136", "2", "2016-01-27 09:34:50", "2016-01-27 14:34:50", "<p class=\"p1\"><span class=\"s1\">Every supply chain is different. Yet they are all driven by the cost of transportation. Burris Logistics can help you control your transportation spend, maximize equipment utilization and optimize customer service performance. We consider your inbound requirements as well as your outbound customer needs.</span></p>\n<p class=\"p1\"><span class=\"s1\">Our team learns about your company, your needs and your unique requirements to help you achieve your goals and objectives.</span></p>\n<p class=\"p1\"><span class=\"s1\">Burris Logistics offers truckload, drayage and cross-dock services specializing in temperature-controlled solutions. In addition to our asset-based fleet, Burris Logistics has a core carrier base to facilitate truckload shipments nationwide. </span></p>\n<p class=\"p1\"><span class=\"s1\">With strategically located climate-controlled warehouses, Burris Logistics is positioned to offer storage, distribution and cross-dock services that correspond with your transportation needs. </span></p>", "About", "", "inherit", "closed", "closed", "", "12-autosave-v1", "", "", "2016-01-27 09:34:50", "2016-01-27 14:34:50", "", "12", "https://burrisfreight.com/2016/01/27/12-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("137", "2", "2016-01-27 09:35:17", "2016-01-27 14:35:17", "<p class=\"p1\"><span class=\"s1\">Every supply chain is different. Yet they are all driven by the cost of transportation. Burris Logistics can help you control your transportation spend, maximize equipment utilization and optimize customer service performance. We consider your inbound requirements as well as your outbound customer needs.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">Our team learns about your company, your needs and your unique requirements to help you achieve your goals and objectives.</span></p>\r\n<p class=\"p1\"><span class=\"s1\">Burris Logistics offers truckload, drayage and cross-dock services specializing in temperature-controlled solutions. In addition to our asset-based fleet, Burris Logistics has a core carrier base to facilitate truckload shipments nationwide. </span></p>\r\n<p class=\"p1\"><span class=\"s1\">With strategically located climate-controlled warehouses, Burris Logistics is positioned to offer storage, distribution and cross-dock services that correspond with your transportation needs. </span></p>", "About", "", "inherit", "closed", "closed", "", "12-revision-v1", "", "", "2016-01-27 09:35:17", "2016-01-27 14:35:17", "", "12", "https://burrisfreight.com/2016/01/27/12-revision-v1/", "0", "revision", "", "0");
