INSERT INTO `wp_posts` VALUES("193", "2", "2016-01-27 14:29:27", "2016-01-27 19:29:27", "<img class=\"alignleft size-full wp-image-170\" src=\"https://burrisfreight.com/wp-content/uploads/2015/12/Maria_Wittmeyer.jpg\" alt=\"Maria_Wittmeyer\" width=\"150\" /><strong>Maria Wittmeyer</strong>\r\nVice President, Transportation - Burris Logistics\r\n451 Fletchwood Road, Elkton, MD 21921\r\nE: <a href=\"mailto:mwittmeyer@burrislogistics.com\">mwittmeyer@burrislogistics.com\r\n</a>P: <a href=\"tel:443.245.1114\">443-245-1114\r\n</a>\r\n\r\n<hr style=\"border: 0;\" />\r\n\r\n&nbsp;\r\n\r\n<strong><img class=\"alignleft size-full wp-image-169\" src=\"https://burrisfreight.com/wp-content/uploads/2015/12/Anthony_Megale.jpg\" alt=\"Anthony_Megale\" width=\"150\" />Anthony Megale</strong>\r\nVice President, Transportation Business Development - Burris Logistics\r\n10900 Central Port Drive, Orlando, FL 32824\r\nE: <a href=\"mailto:amegale@burrislogistics.com\">amegale@burrislogistics.com</a>\r\nP:<a href=\"tel:407.852.7222\">407-852-7222</a>", "Leadership", "", "inherit", "closed", "closed", "", "15-revision-v1", "", "", "2016-01-27 14:29:27", "2016-01-27 19:29:27", "", "15", "https://burrisfreight.com/2016/01/27/15-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("194", "2", "2016-01-28 09:03:29", "2016-01-28 14:03:29", "", "Front Page", "", "inherit", "closed", "closed", "", "34-revision-v1", "", "", "2016-01-28 09:03:29", "2016-01-28 14:03:29", "", "34", "https://burrisfreight.com/2016/01/28/34-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("195", "2", "2016-02-05 16:43:00", "2016-02-05 21:43:00", "<p class=\"quote-link\" style=\"display:inline-block;float:right;text-align: center;\"><a class=\"button large secondary\" href=\"https://burrisfreight.com/customers/get-a-quote/\">GET A QUOTE</a></p>\r\n<strong>Your shipping challenge. Our solutions.</strong>\r\n\r\nBurris Freight Management offers comprehensive transportation solutions including a vast network of carriers and facilities. Combined with nearly a century of experience and a dedicated team, our customers count on Burris to \"Make It Happen.\"\r\n\r\nA non-asset based provider oftransportation services, we can expand capacity to meet the needs of our customers through a growing alliance of carriers. Because we offer dedicated lanes and are committed to positive, respectful relationships with carriers/drivers, our customers can rely on Burris Freight Management toprovide quality service.\r\n\r\nBurris is a long-standing and trusted name in the logistics industry, with award-winning climate controlled facilities that can offer short-term and long-term storage of product.\r\n\r\nTechnology is vital to the timely pairing of customer and carriers. Burris uses web-based resources to register customers, as well as carriers, marrying available lanes to the best transportation option.\r\n\r\nWe have longevity, an experienced team, technology and the carrier alliance customers require. Contact Burris Freight Management today  we re ready to make your challenge, our solution.", "Customers", "", "inherit", "closed", "closed", "", "6-autosave-v1", "", "", "2016-02-05 16:43:00", "2016-02-05 21:43:00", "", "6", "https://burrisfreight.com/2016/01/28/6-autosave-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("196", "2", "2016-01-28 09:05:55", "2016-01-28 14:05:55", "Your shipping challenge. Our solutions.\r\n \r\nBurris Freight Management offers comprehensive transportation solutions including a vast network of carriers and facilities. Combined with nearly a century of experience and a dedicated team, our customers count on Burris to \"make it happen.\"\r\n \r\nA non-asset based provider of brokered services, we can expand capacity to meet the needs of our customers through a growing alliance of carriers throughout the country. Because we offer dedicated lanes and are committed to positive, respectful relationships with carriers/drivers, our customers can rely on Burris Freight Management to be on time, every time.\r\n \r\nBurris is a long-standing and trusted name in the logistics industry, with award-winning climate controlled facilities that can offer short-term and long-term storage of product.\r\n \r\nTechnology is vital to the timely pairing of customer and carriers. Burris uses web-based resources to register customers, as well as carriers, marrying available lanes to the best transportation option.\r\n \r\nWe have longevity, experienced team, technology and the carrier alliance customers require. Contact Burris Freight Management today  we re ready to make your challenge, our solution.", "Customers", "", "inherit", "closed", "closed", "", "6-revision-v1", "", "", "2016-01-28 09:05:55", "2016-01-28 14:05:55", "", "6", "https://burrisfreight.com/2016/01/28/6-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("198", "2", "2016-01-28 09:19:26", "2016-01-28 14:19:26", "<strong>Grow with Burris.</strong>\r\n \r\nBurris Freight Management, a division of Burris Logistics, respects the needs of carriers and the drivers on which we all rely. With dedicated lanes, prompt payment systems and well-run warehouses, we are the transportation leader of choice among a growing alliance of carriers.\r\n \r\nThey say what they are going to.. and they do it.\r\nI get in and out and back on the road.. and I appreciate that.\r\nOur firm had two trucks when we signed on with Burris, and now we have a dozen.\r\nThey make doing business simple and easy  and that\'s unusual in the trucking industry.\r\n \r\nCarriers tell us, every day, that Burris Freight Management is one of the better companies to deal with  and were proud of our growing reputation. A respected name in the logistics industry for nearly a century, we fully understand the needs of our carrier allies and we do whatever it takes to assure a smooth operation and relationship.\r\n \r\n7-days a week, round-the-clock, we provide information, technology and support to our nation-wide carrier network. From prompt payment processing to web-based portal for lane registration, we do all we can to make it easy and efficient  because when are carriers are part of the solution, we can meet any challenge.\r\n \r\nIf you are interested in becoming a carrier for Burris Freight Management, contact us, today  we welcome your inquiry.", "Carriers", "", "inherit", "closed", "closed", "", "11-revision-v1", "", "", "2016-01-28 09:19:26", "2016-01-28 14:19:26", "", "11", "https://burrisfreight.com/2016/01/28/11-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("199", "2", "2016-01-28 09:23:51", "2016-01-28 14:23:51", "<strong>Your shipping challenge. Our solutions.</strong>\r\n \r\nBurris Freight Management offers comprehensive transportation solutions including a vast network of carriers and facilities. Combined with nearly a century of experience and a dedicated team, our customers count on Burris to \"make it happen.\"\r\n \r\nA non-asset based provider of brokered services, we can expand capacity to meet the needs of our customers through a growing alliance of carriers throughout the country. Because we offer dedicated lanes and are committed to positive, respectful relationships with carriers/drivers, our customers can rely on Burris Freight Management to be on time, every time.\r\n \r\nBurris is a long-standing and trusted name in the logistics industry, with award-winning climate controlled facilities that can offer short-term and long-term storage of product.\r\n \r\nTechnology is vital to the timely pairing of customer and carriers. Burris uses web-based resources to register customers, as well as carriers, marrying available lanes to the best transportation option.\r\n \r\nWe have longevity, experienced team, technology and the carrier alliance customers require. Contact Burris Freight Management today  we re ready to make your challenge, our solution.", "Customers", "", "inherit", "closed", "closed", "", "6-revision-v1", "", "", "2016-01-28 09:23:51", "2016-01-28 14:23:51", "", "6", "https://burrisfreight.com/2016/01/28/6-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("200", "2", "2016-01-28 09:35:46", "2016-01-28 14:35:46", "<strong>Grow with Burris.</strong>\r\n \r\nBurris Freight Management, a division of Burris Logistics, respects the needs of carriers and the drivers on which we all rely. With dedicated lanes, prompt payment systems and well-run warehouses, we are the transportation leader of choice among a growing alliance of carriers.\r\n \r\nThey say what they are going to.. and they do it.\r\nI get in and out and back on the road.. and I appreciate that.\r\nOur firm had two trucks when we signed on with Burris, and now we have a dozen.\r\nThey make doing business simple and easy  and that\'s unusual in the trucking industry.\r\n \r\nCarriers tell us, every day, that Burris Freight Management is one of the better companies to deal with  and were proud of our growing reputation. A respected name in the logistics industry for nearly a century, we fully understand the needs of our carrier allies and we do whatever it takes to assure a smooth operation and relationship.\r\n \r\n7-days a week, round-the-clock, we provide information, technology and support to our nation-wide carrier network. From prompt payment processing to web-based portal for lane registration, we do all we can to make it easy and efficient  because when are carriers are part of the solution, we can meet any challenge.\r\n \r\nIf you are interested in becoming a carrier for Burris Freight Management, contact us, today  we welcome your inquiry.", "Carriers", "", "inherit", "closed", "closed", "", "11-revision-v1", "", "", "2016-01-28 09:35:46", "2016-01-28 14:35:46", "", "11", "https://burrisfreight.com/2016/01/28/11-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("201", "2", "2016-01-28 12:48:57", "2016-01-28 17:48:57", "<strong>Where tradition meets innovation.</strong>\r\n \r\nWhile Burris freight management uses leading-edge registration, quoting and tracking technology, we pride ourselves on traditional, direct communication with customers and carriers.\r\n \r\nTheres no better way to build a relationship than through listening which is why every new arrival to our roster, begins with a conversation. Our logistic experts and account managers are available to answer any questions and provide trusted, experienced advice.\r\n \r\nOnce a carrier or customer is established, web-based platforms are engaged to build profiles, register for lanes and to confirm all costs. In this way we can instantly identify carrier capacity and marry customers to the most efficient solution.\r\n \r\nWhether seeking to ship a load, or seeking to grown a carrier operation, contact us, today, for timely access to our automated portal technology.ortal technology.", "Technology", "", "inherit", "closed", "closed", "", "90-revision-v1", "", "", "2016-01-28 12:48:57", "2016-01-28 17:48:57", "", "90", "https://burrisfreight.com/2016/01/28/90-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("203", "2", "2016-01-28 13:28:22", "2016-01-28 18:28:22", "<h2>BURRIS LOGISTICS ONLINE PRIVACY POLICY</h2>\r\nBurris Logistics is committed to protecting individual privacy and securing the personal information made available to us when you visit our website. If you chose to provide us with personal information, for example, by completing a Contact Us form, by signing up for our email list, or leaving a comment, we may use that information to respond to your message and/or to help us get you the information or services that you requested. Submitting this information is voluntary and is not required to access information on our site. We do not sell, rent, exchange, or otherwise disclose the information you provide outside the organization. Questions about the policy can be directed to mowens@burrislogistics.com.\r\n<h2>BURRIS LOGISTICS COMMENT POLICY</h2>\r\nThank you for following Burris Logistics on our public sites. Burris Logistics participates in social media and other public sites in order to engage individuals and to share relevant information.\r\n\r\nPosted comments do not necessarily represent the views of Burris Logistics. External links on these sites do not constitute an endorsement by Burris Logistics.\r\n\r\nWhile we encourage our followers to share thoughts and opinions on our public sites, we expect that this will be done in a respectful manner. Burris Logistics does not agree with or endorse every comment that is posted on our pages. Although our goal is to accept the majority of comments posted, we reserve the right to remove any comment that contains hateful, defamatory, or profane language, personal attacks, promotional comments, and spam comments. All links posted as comments are subject to removal. Burris Logistics reserves the right to block an author from access or use of our public sites where the author engages in repeated violations of the Burris Logistics Comment Policy.\r\n\r\nPlease contact <a href=\"mailto:slauzen@burrislogistics.com\">slauzen@burrislogistics.com</a> with any questions about this policy.", "Privacy Policy", "", "inherit", "closed", "closed", "", "31-revision-v1", "", "", "2016-01-28 13:28:22", "2016-01-28 18:28:22", "", "31", "https://burrisfreight.com/2016/01/28/31-revision-v1/", "0", "revision", "", "0");
