INSERT INTO `wp_posts` VALUES("213", "2", "2016-02-02 10:36:18", "2016-02-02 15:36:18", "<strong>Your shipping challenge. Our solutions.</strong>\r\n\r\nBurris Freight Management offers comprehensive transportation solutions including a vast network of carriers and facilities. Combined with nearly a century of experience and a dedicated team, our customers count on Burris to \"make it happen.\"\r\n\r\nA non-asset based provider of brokered services, we can expand capacity to meet the needs of our customers through a growing alliance of carriers throughout the country. Because we offer dedicated lanes and are committed to positive, respectful relationships with carriers/drivers, our customers can rely on Burris Freight Management to be on time, every time.\r\n\r\nBurris is a long-standing and trusted name in the logistics industry, with award-winning climate controlled facilities that can offer short-term and long-term storage of product.\r\n\r\nTechnology is vital to the timely pairing of customer and carriers. Burris uses web-based resources to register customers, as well as carriers, marrying available lanes to the best transportation option.\r\n\r\nWe have longevity, experienced team, technology and the carrier alliance customers require. Contact Burris Freight Management today  we re ready to make your challenge, our solution.\r\n\r\n<p class=\"quote-link\"><a class=\"button large secondary\" href=\"get-a-quote\" tabindex=\"-1\">GET A QUOTE</a></p>", "Customers", "", "inherit", "closed", "closed", "", "6-revision-v1", "", "", "2016-02-02 10:36:18", "2016-02-02 15:36:18", "", "6", "https://burrisfreight.com/2016/02/02/6-revision-v1/", "0", "revision", "", "0");
