INSERT INTO `wp_posts` VALUES("234", "2", "2016-02-05 16:39:57", "2016-02-05 21:39:57", "<strong>Delaware (corporate)</strong>\r\n501 SE 5th Street\r\nMilford, DE 19963\r\n<a href=\"tel:800.805.8135\">(800) 805-8135</a>\r\n\r\n<strong>Maryland</strong>\r\n451 Fletchwood Road\r\nElkton, MD 21921\r\n<a href=\"tel:443.245.1159\">(443) 245-1159</a>\r\n\r\n<strong>Florida</strong>\r\n10900 Central Port Drive\r\nOrlando, FL 32824\r\n<a href=\"tel:407.852.7299\">(407) 852-7299</a>\r\n\r\n4501 Dignan Street\r\nJacksonville, FL 32254\r\n<a href=\"tel:904.265.5990\">(904) 265-5990</a>\r\n\r\n&nbsp;\r\n<h3>Leave us a message:</h3>\r\n[gravityform id=\"5\" title=\"false\" description=\"false\"]", "Contact Information", "", "inherit", "closed", "closed", "", "13-revision-v1", "", "", "2016-02-05 16:39:57", "2016-02-05 21:39:57", "", "13", "https://burrisfreight.com/2016/02/05/13-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("235", "2", "2016-02-05 16:43:18", "2016-02-05 21:43:18", "<p class=\"quote-link\" style=\"display:inline-block;float:right;text-align: center;\"><a class=\"button large secondary\" href=\"https://burrisfreight.com/customers/get-a-quote/\">GET A QUOTE</a></p>\r\n<strong>Your shipping challenge. Our solutions.</strong>\r\n\r\nBurris Freight Management offers comprehensive transportation solutions including a vast network of carriers and facilities. Combined with nearly a century of experience and a dedicated team, our customers count on Burris to \"Make It Happen.\"\r\n\r\nA non-asset based provider oftransportation services, we can expand capacity to meet the needs of our customers through a growing alliance of carriers. Because we offer dedicated lanes and are committed to positive, respectful relationships with carriers/drivers, our customers can rely on Burris Freight Management toprovide quality service.\r\n\r\nBurris is a long-standing and trusted name in the logistics industry, with award-winning climate controlled facilities that can offer short-term and long-term storage of product.\r\n\r\nTechnology is vital to the timely pairing of customer and carriers. Burris uses web-based resources to register customers, as well as carriers, marrying available lanes to the best transportation option.\r\n\r\nWe have longevity, an experienced team, technology and the carrier alliance customers require. Contact Burris Freight Management today  we re ready to make your challenge, our solution.", "Customers", "", "inherit", "closed", "closed", "", "6-revision-v1", "", "", "2016-02-05 16:43:18", "2016-02-05 21:43:18", "", "6", "https://burrisfreight.com/2016/02/05/6-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("236", "2", "2016-02-05 16:43:48", "2016-02-05 21:43:48", "<p class=\"quote-link\" style=\"display:inline-block;float:right;text-align: center;\"><a class=\"button large secondary\" href=\"https://burrisfreight.com/carriers/register-with-us/\">CARRIER REGISTER</a></p>\r\n<strong>Grow with Burris.</strong>\r\n \r\nBurris Freight Management, a division of Burris Logistics, respects the needs of carriers and the drivers on which we all rely. With dedicated lanes, prompt payment systems and well-run warehouses, we are the transportation leader of choice among a growing alliance of carriers.\r\n \r\nThey say what they are going to do.. and they do it.\r\nI get in and out and back on the road.. and I appreciate that.\r\nOur firm had two trucks when we signed on with Burris, and now we have a dozen.\r\nThey make doing business simple and easy  and that\'s unusual in the trucking industry.\r\n \r\nCarriers tell us, every day, that Burris Freight Management is a preferred vendor  and were proud of our growing reputation. A respected name in the logistics industry for nearly a century, we fully understand the needs of our carrier allies and we do whatever it takes to assure a smooth operation and relationship.\r\n \r\nOur operations center is staffed 24/7 to provide information, technology and support to our nation-wide carrier network. From prompt payment processing to web based portal for load requests and acceptance, we do all we can to make it easy and efficient  because when our carriers are part of the solution, we can meet any challenge.\r\n \r\nIf you are interested in becoming a carrier for Burris Freight Management, contact us, today  become part of the solution.", "Carriers", "", "inherit", "closed", "closed", "", "11-revision-v1", "", "", "2016-02-05 16:43:48", "2016-02-05 21:43:48", "", "11", "https://burrisfreight.com/2016/02/05/11-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("237", "2", "2016-02-12 17:04:11", "2016-02-12 22:04:11", "<p class=\"quote-link\" style=\"display:inline-block;float:right;text-align: center;\"><a class=\"button large secondary\" href=\"https://burrisfreight.com/customers/get-a-quote/\">GET A QUOTE</a></p>\r\n<strong>Your shipping challenge. Our solutions.</strong>\r\n\r\nBurris Freight Management offers comprehensive transportation solutions including a vast network of carriers and facilities. Combined with nearly a century of experience and a dedicated team, our customers count on Burris to \"Make It Happen.\"\r\n\r\nA non-asset based provider of transportation services, we can expand capacity to meet the needs of our customers through a growing alliance of carriers. Because we offer dedicated lanes and are committed to positive, respectful relationships with carriers/drivers, our customers can rely on Burris Freight Management to provide quality service. Differentiating us from most brokerages, our operations center is staffed 24/7 to monitor shipments, assist carriers and support our customers. Additional services that we offer are both dry and temperature-controlled truckload, container and intermodal solutions as well as temperature-controlled LTL.\r\n\r\nBurris is a long-standing and trusted name in the logistics industry, with award-winning climate controlled facilities that can offer short-term and long-term storage of product.\r\n\r\nTechnology is vital to the timely pairing of customer and carriers. Burris uses web-based resources to register customers, as well as carriers, marrying available lanes to the best transportation option.\r\n\r\nWe have longevity, an experienced team, technology and the carrier alliance customers require. Contact Burris Freight Management today  we re ready to make your challenge, our solution.", "Customers", "", "inherit", "closed", "closed", "", "6-revision-v1", "", "", "2016-02-12 17:04:11", "2016-02-12 22:04:11", "", "6", "https://burrisfreight.com/2016/02/12/6-revision-v1/", "0", "revision", "", "0");
