INSERT INTO `wp_rg_lead_detail` VALUES("45", "7", "5", "4", "Dear Sir,\r\n\r\n\r\nI am Alak Bhattacharjee Business Development G.M. of  Confer Container Line ,Bangladesh. \r\n\r\n\r\nCONFER CONTAINER LINE, is a dynamic international freight forwarding company operting 3 offices in Bangladesh wide covering seaports and airports. Our 3 offices are now operational and can handle both air and sea on that sides. We belong to the top class A  forwarder for air and sea and NVOCC with strong workforce.We excel in Asian,European and American Lane especially from major Bangladesh ports like Chittagong,Khulna and Dhaka. \r\n\r\nWe are keeping very good relations with CSCL/MSC/APL/NORASIA/CMA/MOL/HANJIN/COSCO/NYK/MCC in Bangladesh and can provide competitive rates  for both FCL and LCL shipment.\r\n\r\nWe  have very strong airfreight division based at Dhaka airport. Also have good relation with all airlines like DRAGON/EK/SQ/EY/BG/SV/BA/MH/Q/ PIA / TG and can provide good rate for any destination in the whole world. \r\n\r\n\r\nWe have good wish to build up co-operation with your esteem company.We will provide you good service to handle your  shipment to/from Bangladesh.  We have strong and skill team work in CFS who are professional and also we have own surveyor team in CFS who will provide report on overall work in CFS about Sea &amp; Air shipment.Hence we will met your requirement whatever you need, we have such strength here.\r\n\r\nWe do provide attractive incentive and provide good support to our partner for their consol box to Chittagong. Hence you can advise if you have interest to make consol to Chittagong.Also we provide good incentive for FCL &amp; LCL shipment to Chittagong.\r\n\r\n\r\nIf you have any quires for any sort of co-operation pls ask us freely, we will try our level best to meet your requirement. \r\n\r\n\r\nCONFER is engaged in the following activities: \r\n\r\n\r\n* MTO &amp;NVOCC Operation\r\n* Liner Agency\r\n* Warehousing, Depots &amp; CFS\r\n* Consolidation\r\n\r\nI hope the above summary would give you better information. \r\n\r\nThank you and looking forward to a possible co-operation with your  esteemed company network.\r\n\r\n\r\n\r\nThanks&amp;Best Regards\r\nAlak Bhattacharjee\r\nBusiness Development G.M\r\n\r\nCONFER CONTAINER LINE\r\nShatabdi Centre Rm#G-5(5TH FL,),\r\n292,Inner Circular Road, Fakirapool,\r\nDhaka-1000,Bangladesh.\r\n(               :880-2-7192427,7193172,7191162,\r\n6               :880-2-7194965\r\nMob             : 88-01715365340\r\n*               :cfltsh@link3.net\r\nHotmail         : alakbangladesh@hotmail.com\r\nSkype   : tapumonti2009\r\n\r\nCHITTAGONG OFFICE\r\nTNS COMPLEX (1st Fl.,)\r\n89-90,Agrabad C/A,Chittagong-4100,\r\nBangladesh.\r\n(               : 880-31-714900\r\n6               : 880-31-711159\r\n\r\n\r\nKHULAN (MONGLA)OFFICE: \r\n78 KHANJAHAN NAGAR, \r\n(GOBARCHAKA) MAIN ROAD, \r\nKHULNA,BANGLADESH. \r\nTel              : 880-41-729321  \r\nFax          : 880-41-729321");
