INSERT INTO `wp_rg_lead_detail` VALUES("294", "44", "1", "6", "Good Morning\r\n\r\nHow are you? Please allow me to introduce Right Service Right Choice for your shipping needs.\r\n\r\nRSRC is an asset based carrier with a full logistics division out of Mississauga, ON with operating authorities for Canada, USA & Mexico. Our operations is available 24*7 with terminals in Mississauga, ON and Laredo, TX. \r\nWe run approximately 50 of our own trucks into TX specializing in TL, LTL & Expedite shipments. Our service record is our pride & joy as we hold at current a 100% service on-time delivery record for customers such as General Motors, Ford and Chrysler as we are 1 of their preferred carriers for the past few years.\r\nWe also have 30,000 sq. of warehouse in both Mississauga ON and Laredo TX with storage and cross dock facilities. RSRC is also CTPAT, PIP, bonded (CDN & US) and fast certified.\r\nAreas served Canada-USA-Mexico.\r\n\r\nIf you get us set up for RFQs or any projects/shipments we can quote ; we would be happy to speak with you.\r\n \r\nSCAC CODE:TTW \r\nMC-783320\r\nUS DOT-2294033\r\n\r\nHope to hear back from you soon, have a nice day");
