INSERT INTO `wp_rg_lead_detail` VALUES("402", "61", "1", "6", "Just wanted to check in on those lanes you normally ship and show you how my rates compare if you could please send them to me. \r\n\r\nWe had made deliveries to or from your facility in the past and I want to talk with you briefly about becoming your Truckload Provider and guarantee competitive pricing on all lanes. As an industry leader in transportation we are focused on our customers satisfaction with your logistics services and developing the best experience possible in a timely manner.  My job here is to provide you with superior service for any local, long haul and regional delivery you may have. Here is brief description of our company We are ranked #34 out of the top 100 trucking businesses in the country, along with 92 terminals across the US and Canada with over 1,700 of our own trucks and with over 3,500 carrier partners. Our strong points are anything east of the Mississippi but can handle any shipment\'s needed. Down below are a list of my contacts.  \r\n\r\nWe at Forward Air Logistics offer a wide range of transportation services.  I am focused on servicing our customers Full Truckload shipments.  We can provide truckload services for Dry Van, Temperature Controlled (Reefer), flat bed and  step deck shipments across the United States and Canada.\r\n\r\nOur 3PL Logistics network offers asset-based truckload services and leverage our nationwide contracted carrier network of over 3,500 carrier partners to provide brokerage rates for single shipments and lanes, as well as negotiated contracts for dedicated programs.  We have a quality control staff that continuously tracks the status of our customer\'s shipments to provide an even greater level of precision to our customers.  \r\n\r\n\"No matter your truckload need we can offer a solution.  Standard, Expedited, High Value High Risk, Hazmat, Special Projects, cross boarder shipments, we have trained professionals to assist you!\"");
