INSERT INTO `wp_rg_lead_detail` VALUES("1041", "164", "5", "4", "Good morning , \r\nMy name is Frank and I am from Logistic Dynamics Inc a non-asset freight brokerage out of Buffalo, NY  The reason I am emailing you today is to see if you are interested in our freight brokerage/transportation services? Our corporate office if in Buffalo, NY with satellite offices across the country I reside in  Bakersfield,  California, the heart of the San Joaqun Valley where most of our fresh produce is grown and harvested. I also move proteins( Pork , Beef , Poultry  ) from the Midwest and south and produce from WA, CA, ID, CO, TX, and AZ. If you have any questions or concerns , feel free to email me and can send you quotes for our lanes.  Attached to this email  is our business information Thank you  for your time and have a great week!\r\nE: fcerda@logisticdynamics.net \r\nMC#471231.\r\nC:831-594-3213");
