INSERT INTO `wp_rg_lead_detail` VALUES("1048", "165", "2", "4", "Good morning\r\n \r\nIm looking to establish a long term relationship with a carrier to move 20 or 40 containers of flooring from various ports to various destination in the US.  Depending on the port and destination, the optimal configuration may require permits and special equipment to maximize the payload.  Let me know if you have interest in establishing a relationship.  To start, I need rates, maximum payload (With and without permits and special heavy haul equipment) and equipment availability to move a 20 or 40 containers from and to:\r\n \r\nNorfolk, VA to Williamsburg, VA\r\nBaltimore, MD to New Castle, DE\r\nBaltimore, MD to Harrisburg, PA\r\nSeattle, WA to Tualatin, OR\r\n \r\nCurrently, we move containers through Long Beach, CA and Port of Miami.  \r\n \r\nSincerely,\r\n \r\nBob");
