INSERT INTO `wp_rg_lead_detail` VALUES("1231", "195", "5", "4", "I am fairly certain it was a truck of yours that I witnessed this morning driving at what I would classify an excessive rate of speed, here in Fort Myers, Florida, on I75 North, near exit 136. Around 6am, I was heading north and a truck with the name Burris and #371 on back, entered the highway, quickly moved to the center lane behind me, as I was passing another semi truck. I could tell he was moving  faster than I was, so I sped up from 75 to 80 mph. The speed limit here is 70.  As soon as we cleared the 1st semi, your driver moved to the right lane and passed me fairly quickly, so at this time had to be driving at least 85 miles an hour.  There are quite a few exits and entrance ramps along this stretch of I75 North through Fort Myers,  and at 6:00 a.m. it\'s quite busy.  Perhaps you should look into the driving habits of your drivers, as I felt like he was not only putting my life but the lives of other drivers in danger.");
