INSERT INTO `wp_rg_lead_detail` VALUES("1684", "265", "5", "4", "We are based in Kampala and are looking for company who can act as our\r\nForwarding/shipping/sourcing/purchasing agents for our clients project\r\nhere because most of the companies we have contacted have advised us they\r\ndo not ship out of country.\r\n\r\nMost of them have advised us to find a forwarding firm my clients can send\r\nto and this company will do the sourcing/purchasing of the Merchandise and\r\nalso ship it to our country but the sourcing and\r\npurchasing services will be paid for by my client the clients with a 10%\r\ncharge commission on every order purchase and shipped to us because right\r\nnow their project is on a stand still with out the Equipment\r\n\r\n\r\nSo as their clearing Agents here,they told us to look for a company\r\nwilling to do all services. Their project is to last for 3 years here and\r\nhope by the time its done your company and ours will have built a long\r\nterm business relationship.\r\n\r\nIf the above services are in the line of your company business, let us\r\nknow so that we can give you Specifications of the required Equipment.\r\n\r\nHope you are on watsap and send me your watsap number.\r\n\r\nWaiting for your reply soon\r\n\r\nMuthabali Elisha\r\n\r\nCEO\r\nGSKBROKERS\r\nPlot No.33, Buloba opp police,\r\nBandwe-Mityana Road,\r\nUganda-East Africa.\r\nTel:+256 741903660");
