INSERT INTO `wp_rg_lead_detail_long` VALUES("279", "Good afternoon,\r\n\r\nQuest Global has 210 + trucks and a full service brokerage with access to truck companies nationwide.  Wed love to help with your distribution needs if you use outside carriers from your own fleet.\r\n\r\nBest Regards,\r\n\r\nChristopher Gable\r\nQuest Global Logistics\r\n678-455-9381");
INSERT INTO `wp_rg_lead_detail_long` VALUES("287", "I heard good things about burris logicstic and j would like to be part of those good things....my company has one truck and one reefer trailer, both are and bery good condition.....thanks for your time....");
INSERT INTO `wp_rg_lead_detail_long` VALUES("294", "Good Morning\r\n\r\nHow are you? Please allow me to introduce Right Service Right Choice for your shipping needs.\r\n\r\nRSRC is an asset based carrier with a full logistics division out of Mississauga, ON with operating authorities for Canada, USA & Mexico. Our operations is available 24*7 with terminals in Mississauga, ON and Laredo, TX. \r\nWe run approximately 50 of our own trucks into TX specializing in TL, LTL & Expedite shipments. Our service record is our pride & joy as we hold at current a 100% service on-time delivery record for customers such as General Motors, Ford and Chrysler as we are 1 of their preferred carriers for the past few years.\r\nWe also have 30,000 sq. of warehouse in both Mississauga ON and Laredo TX with storage and cross dock facilities. RSRC is also CTPAT, PIP, bonded (CDN & US) and fast certified.\r\nAreas served Canada-USA-Mexico.\r\n\r\nIf you get us set up for RFQs or any projects/shipments we can quote ; we would be happy to speak with you.\r\n \r\nSCAC CODE:TTW \r\nMC-783320\r\nUS DOT-2294033\r\n\r\nHope to hear back from you soon, have a nice day");
INSERT INTO `wp_rg_lead_detail_long` VALUES("301", "Marios Xpress, LLC Is a new fast growing woman-minority trucking company located in Atlanta, Georgia, providing refrigerated and frozen freight services (not limited to) for the refrigerated transportation industry. At Marios Xpress we value our clients by offering premier customer service from the beginning until the end of each transaction. Proper handling of our customers products and safety to motoring public are our top priorities at Marios Xpress.\r\nOur straight truck is fully equipped, we provide up to one million dollars in insurance as well as our top talent drivers who are prepared to begin work as soon as possible. Our top skilled drivers will assist with loading and unloading our client products. Gas is on US and if we dont deliver in a timely manner we will offer a discount. We are on call 24 hours a day and 7 days a week to meet the business needs of our client.  \r\nI look forward to speaking with your company\'s decision makers soon to answer any questions as well as providing any supporting documentation.  \r\n\r\n No need to pitch a sales pitch because our sales pitch is our service; we are delivery YOU can count on.\r\n\r\nBest regards,\r\n\r\nMarkeitha Davis-Owner\r\nMarkeitha@mariosxpressllc.com \r\nDOT#2859046");
INSERT INTO `wp_rg_lead_detail_long` VALUES("359", "we are a carrier that gets the job done we say what we do and do what we say.quality services on time service is our motto.we are sincerely interested in partnering with you guys.we have heard great things about Burris.two great companies coming together Burris logistics and Scott\'s Transportation.please contact us.ASAP");
INSERT INTO `wp_rg_lead_detail_long` VALUES("402", "Just wanted to check in on those lanes you normally ship and show you how my rates compare if you could please send them to me. \r\n\r\nWe had made deliveries to or from your facility in the past and I want to talk with you briefly about becoming your Truckload Provider and guarantee competitive pricing on all lanes. As an industry leader in transportation we are focused on our customers satisfaction with your logistics services and developing the best experience possible in a timely manner.  My job here is to provide you with superior service for any local, long haul and regional delivery you may have. Here is brief description of our company We are ranked #34 out of the top 100 trucking businesses in the country, along with 92 terminals across the US and Canada with over 1,700 of our own trucks and with over 3,500 carrier partners. Our strong points are anything east of the Mississippi but can handle any shipment\'s needed. Down below are a list of my contacts.  \r\n\r\nWe at Forward Air Logistics offer a wide range of transportation services.  I am focused on servicing our customers Full Truckload shipments.  We can provide truckload services for Dry Van, Temperature Controlled (Reefer), flat bed and  step deck shipments across the United States and Canada.\r\n\r\nOur 3PL Logistics network offers asset-based truckload services and leverage our nationwide contracted carrier network of over 3,500 carrier partners to provide brokerage rates for single shipments and lanes, as well as negotiated contracts for dedicated programs.  We have a quality control staff that continuously tracks the status of our customer\'s shipments to provide an even greater level of precision to our customers.  \r\n\r\n\"No matter your truckload need we can offer a solution.  Standard, Expedited, High Value High Risk, Hazmat, Special Projects, cross boarder shipments, we have trained professionals to assist you!\"");
INSERT INTO `wp_rg_lead_detail_long` VALUES("409", "We are running 50 power units along with 60 refrigerated trailers currently. We run the lower 48 states. We carry anything perishable as well as dry freight when we need to. The majority of our refer trailers are 53 high cube which gives us some flexibility. All of our power units are Qualcomm equipped. We provide excellent service to our customers and would be delighted with an opportunity to serve Burris Logistics.");
INSERT INTO `wp_rg_lead_detail_long` VALUES("421", "Good morning, we are looking for companies that can use a company to help them move freight.  We move freight to all 48 states using Reefer, Van and Flatbed trailers.   We are in contact with over 750 trucking companies and owner operators who contact us everyday with trucks they need loads for and their locations.  We are an approved carrier for UNIPRO and Lineage.  Please have someone contact us about how to become a carrier for you.  Thank You");
INSERT INTO `wp_rg_lead_detail_long` VALUES("449", "Good day.\r\n\r\nMy name is Brook Allgood, I am an account manager with Scotlynn Commodities.  \r\n\r\nWe are a transportation company headquartered in Vittoria Ontario, with multiple offices in both Canada and the United States.  Our fleet is over three hundred strong, consisting mostly of Reefers and Dry Vans which are positioned throughout North America.  We currently move freight for the major grocery chains in Canada, such as Loblaws and Metro, as well as many other companies in both Canada and the United States. We have a strong focus on Customer Service, which is why we believe in our customers having one point of contact within our company;  your Scotlynn representative is always available to service your needs.  Freight doesnt stop, and neither do we. \r\n\r\nIf you would like to know more about Scotlynn, please visit our website at www.scotlynn.com\r\n\r\nThank you for your time and consideration, and I hope to speak with you soon.\r\n\r\nSincerely,\r\n\r\nBrook Allgood\r\nAccount Manager\r\nScotlynn Commodities");
INSERT INTO `wp_rg_lead_detail_long` VALUES("467", "Echo was moving loads from multiple locations inbound to the Atlanta location in 2011-2012. Please let me know what we need to do to get back on board either through a spot or RFP opportunity. I know each location handles somethings on their own but would like access to bid on current lanes if possible");
INSERT INTO `wp_rg_lead_detail_long` VALUES("468", "I saw your site today -  burrisfreight.com\n\nThere is a Chinese company that has created 10,000s of millionaires opening up to the world for the first time ever.  People with little money became millionaries from this company and now you get the chance!  I\'m in this and want you to watch this short video.\n\nWatch this video\nhttps://vimeo.com/170306735\n\nand send me an email to glenn@crankmoney.com with your name and phone number if you want more information.  This is once in a lifetime chance to earn big from a small investment as the Chinese have done.\n\nHere\'s my latest news posts I\'m sure you will enjoy and share.  Make sure you join my newsletter at www.crankmoney.com if you want to be informed of these stories not on the fake news on TV!\n\nHillary Clinton Child Rape Ends Campaign\n\nhttp://beforeitsnews.com/alternative/2016/06/hillary-clinton-child-rape-ends-her-campaign-3368357.html\n\nBackup Link\nhttp://www.project.nsearch.com/profiles/blogs/hillary-clinton-child-rape-bombshell-exploding\n\n\nEmail me at glenn@crankmoney.com if you need anything!\n\nGlenn Canady");
INSERT INTO `wp_rg_lead_detail_long` VALUES("475", "Address - 506, Popatlal Chambers, 4th Clive, Cross Lane, Dana Bunder, Masjid East\r\n\r\nI\'m looking to understand if Burris Freight is open to have an agency tie-up in India. We can provide handling services of your clients cargo from India to USA\r\n\r\nThanks\r\nSandeep Bhalotia\r\nFounder\r\nM: +91 9820503281");
